#include <bits/stdc++.h>
using namespace std;

int get_smaller(vector<vector<int>>& jobs, int end, int sTime){
    int lo = 0;
    int hi = end;
    int mid = 0;
    int res = 0;
    while(lo < hi){
        mid = lo + (hi-lo)/2;
        int endTime = jobs[mid][0];
        if(endTime <= sTime){
            res = endTime;
            lo = mid+1;
        }
        else{
            hi = mid;
        }
    }
    return res;
}
    
int jobScheduling(vector<int>& startTime, vector<int>& endTime, vector<int>& profit) {
    int n = startTime.size();
    vector<vector<int>> jobs(n, vector<int>(n, 0));
    
    for(int i=0;i<n;i++){
        vector<int> temp{endTime[i], startTime[i], profit[i]};
        jobs[i] = temp;
    }
    sort(jobs.begin(), jobs.end());
    unordered_map<int, int> dp;
    dp[jobs[0][0]] = jobs[0][2];
    
    for(int i=1;i<n;i++){
        vector<int> cur_job = jobs[i];
        int cur_end = cur_job[0];
        vector<int> prev_job = jobs[i-1];
        int prev_end = prev_job[0];
        int last_end = get_smaller(jobs, i, cur_job[1]);
        
        int profit_choosing = dp[last_end] + cur_job[2];
        int profit_not_choosing = dp[prev_end];
        dp[cur_end] = max(profit_choosing, profit_not_choosing);
    }
    return dp[jobs[n-1][0]];
}

